package com.leetcode.code242;

import java.util.HashMap;
import java.util.Map;
import java.util.Set;

/**
 * Created on 2019-08-01
 *
 * @author :hao.li
 */
public class demo {
    public boolean isAnagram(String s, String t) {
        Map<Character, Integer> map = getMap(s);
        Map<Character, Integer> map1 = getMap(t);
        if (!(map.size() == map1.size())) {
            return false;
        }
        Set<Character> characters = map.keySet();
        boolean flag=false;
        for (char d : characters) {
            if(!map1.keySet().contains(d)){
                flag=true;
                break;
            }
            if (map1.get(d).intValue() != map.get(d).intValue()) {
                flag=true;
                break;
            }

        }
        if(flag){
            return false;
        }
        return true;


    }

    public Map<Character, Integer> getMap(String s) {
        char[] chars = s.toCharArray();
        Map<Character, Integer> map = new HashMap();
        for (char a : chars) {
            Integer o = map.get(a);
            if (o == null) {
                map.put(a, 1);
            } else {
                map.put(a, ++o);
            }
        }
        return map;

    }

    public static void main(String[] args) {
//        String a = "";
//        String b = "";
        String a ="a";
        String b ="d";

        demo d = new demo();
        System.out.println(d.isAnagram(a,b));
    }

}
